import React, { Component } from  'react';

class Recomendacion extends Component{
    render(){
        return(
        <div className="modalRecomenda">
            <div className="row">
                <div></div>
                <img className="imageRecomenda" src={this.props.image}></img>
            </div>
        </div>  
        );
    }
}
export default Recomendacion;
